uocaberis prei{bis ...}
domini parare ui{as ...}
Multe tribulaciones {...}
liberauit eos domi{nus ...}
ossa eo[rum] unum ex hys {...}
cam d[omi]no in omni tempore {...}
Ecce quam bonum {...}
bitare fratres in u{num ...}
tum in ca{pite ...}
dit in {bar}bam
