benedicis iustis domine {...}
tis tue coronasti eo{...}

[One of two portions of an early parchment leaf from a liturgical music ms., probably a gradual, ruled in dark ink (first line below top line) and written in a Gothic bookhand in dark ink with rubrics and initial in red ink and neumes in dark ink. <b>Text:</b> Portions of the gradual, alleluia, offertorium and communio for the feast of St. John the Baptist (June 24) and of the introit, gradual and offertorium for the feast of Sts. John and Paul, martyrs (June 26).]

